import "./Navigation.css"
import logo from "../images/netflix_logo.png"

const Navigation = () => {
    return (
        <header>
            <div className="navigation">
                <img src={logo} alt="netflix_logo" />
            </div>
        </header>
    )
}

export default Navigation
